import React from "react";
import styled from "styled-components";

const Bar = styled.div`
  display: grid;
  grid-template-columns: 8fr auto 1fr 1fr;
  padding: 10px;
  background: #003049;
  color: white;
`;

const NavBar = () => {
  return (
    <Bar>
      <div>Logo</div>
      <div></div>
      <div>News</div>
      <div>About</div>
    </Bar>
  );
};

export default NavBar;
